import Logo from "../assets/images.png";
import "../styles/navbar.css";

const Navbar = () => {
  return (
      <div>
      <header className="header">
        <img className="log" src={Logo} alt="QUIZ" />
        <input className="search-bar" type="text" placeholder="search" />
      </header>


      </div>

  );   
};

export default Navbar;
